export default function About(){
    return (
        <div className="about">
            <h4>About</h4>
            <p>Agu Pavan Kumar is working at RealPage Inc. which is the one of the top companies in India. He has worked in many real-time projects and attended international conferences. He has developed his own application for data management.</p>
        </div>
    )
}
